import './App.css';
import React from 'react';
import { HeadlineDrawing }  from "./components/HeadlineDrawing";
import AppBar from "./components/AppBar/appbar";
import styled ,{ ThemeProvider }  from 'styled-components';
import theme, { GlobalStyle } from './Theme';
import ContentLandingPage from "./components/ContentLandingPage";
import { Router } from 'react-router';





const BallContainer = styled.div`
  position: absolute;
  top: 6rem;
  right: 8rem;
`;

const ContentContainer = styled.div`
  width: 50%;
  margin: 2rem 0 0 4rem;
`;

const App = () => {
  return (
    <Router>
      <div className="App">

      <Bar>

      <Logo><i className = "fas fa-user-ninja"></i></Logo>
      <Headline><Link to="/">BadBoys</Link></Headline>

      <Text><Link to="/test">Team</Link></Text>

      <Text>Spielplan</Text>
      <Text>Tabelle</Text>
      <Text>News</Text>
      <IconContainer>
        <IconButton>
          <Search size={20} />
        </IconButton>
        <IconButton>
          <PersonCircle size={20} />
        </IconButton>
      </IconContainer>

      <Switch>
          <Route path="/test">
            <Test />
          </Route>
          <Route path = "/">
            <Headline />
          </Route>
      </Switch>
    </Bar>



      </div>
    </Router>

  );
}

export default App;
